import React, { useEffect, useState } from "react";
import { startGame, removeNumbers, addNumbers } from "./api/gameApi";
import Board from "./components/Board";
import Controls from "./components/Controls";
import "./App.css";

function saveToLocal(state) {
  try {
    // 데이터 압축: 빈 칸(null)을 제거하고 보드 크기만 저장
    const compressedState = {
      board: state.board.map(row => 
        row.map(cell => cell === null ? 0 : cell) // null을 0으로 변환
      ),
      remaining_adds: state.remaining_adds
    };

    localStorage.setItem("numberGameState", JSON.stringify(compressedState));
  } catch (error) {
    console.warn("Failed to save to localStorage:", error);
    // LocalStorage 용량 초과 시 게임 상태를 초기화
    if (error.name === 'QuotaExceededError') {
      localStorage.clear();
      alert("게임 데이터가 너무 커졌습니다. 새 게임을 시작합니다.");
      window.location.reload();
    }
  }
}

function loadFromLocal() {
  try {
    const saved = localStorage.getItem("numberGameState");
    if (!saved) return null;

    const compressedState = JSON.parse(saved);

    // 압축된 데이터를 원래 형태로 복원
    const state = {
      board: compressedState.board.map(row => 
        row.map(cell => cell === 0 ? null : cell) // 0을 null로 변환
      ),
      remaining_adds: compressedState.remaining_adds
    };

    return state;
  } catch (error) {
    console.warn("Failed to load from localStorage:", error);
    return null;
  }
}

// 보드 크기 제한 및 정리 함수
function cleanBoard(board) {
  // 빈 행 제거 (모든 셀이 null인 행)
  const cleanedBoard = board.filter(row => row.some(cell => cell !== null));

  // 보드가 너무 크면 처음 8행만 유지 (4x9 초기 + 4x9 추가)
  if (cleanedBoard.length > 8) {
    return cleanedBoard.slice(-8);
  }

  return cleanedBoard;
}

export default function App() {
  const [game, setGame] = useState(null);
  const [selectedCells, setSelectedCells] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const saved = loadFromLocal();
    if (saved) {
      // 저장된 게임 상태를 정리
      const cleanedState = {
        ...saved,
        board: cleanBoard(saved.board)
      };
      setGame(cleanedState);
      saveToLocal(cleanedState); // 정리된 상태로 다시 저장
      setIsLoading(false);
    } else {
      startGame().then((data) => {
        setGame(data);
        saveToLocal(data);
        setIsLoading(false);
      }).catch((error) => {
        console.error("Failed to start game:", error);
        setIsLoading(false);
      });
    }
  }, []);

  const handleCellClick = (row, col) => {
    if (!game || game.board[row][col] === null) return;

    const cellKey = `${row},${col}`;
    const isAlreadySelected = selectedCells.some(cell => cell.key === cellKey);

    if (isAlreadySelected) {
      // 이미 선택된 셀을 다시 클릭하면 선택 해제
      setSelectedCells(selectedCells.filter(cell => cell.key !== cellKey));
    } else {
      // 새로운 셀 선택
      const newSelected = [...selectedCells, { row, col, key: cellKey, value: game.board[row][col] }];

      if (newSelected.length === 2) {
        // 두 개의 셀이 선택되면 제거 시도
        const [cell1, cell2] = newSelected;
        if (canRemove(cell1, cell2)) {
          handleRemove([cell1.row, cell1.col], [cell2.row, cell2.col]);
          setSelectedCells([]); // 선택 초기화
        } else {
          // 제거할 수 없으면 선택만 유지
          setSelectedCells(newSelected);
        }
      } else {
        setSelectedCells(newSelected);
      }
    }
  };

  const canRemove = (cell1, cell2) => {
    // 같은 숫자이거나 합이 10인 경우
    return cell1.value === cell2.value || cell1.value + cell2.value === 10;
  };

  const handleRemove = (pos1, pos2) => {
    removeNumbers(game, pos1, pos2).then((data) => {
      // 제거 후 보드 정리
      const cleanedData = {
        ...data,
        board: cleanBoard(data.board)
      };
      setGame(cleanedData);
      saveToLocal(cleanedData);
    }).catch((error) => {
      console.error("Failed to remove numbers:", error);
      // 제거 실패 시 선택 초기화
      setSelectedCells([]);
    });
  };

  const handleAdd = () => {
    addNumbers(game).then((data) => {
      // 추가 후 보드 정리
      const cleanedData = {
        ...data,
        board: cleanBoard(data.board)
      };
      setGame(cleanedData);
      saveToLocal(cleanedData);
    });
  };

  const isCellSelected = (row, col) => {
    return selectedCells.some(cell => cell.row === row && cell.col === col);
  };

  if (isLoading) return <div className="loading">Loading...</div>;

  return (
    <div className="app">
      <h1 className="game-title">Number Game</h1>
      <Board 
        board={game?.board || []} 
        onCellClick={handleCellClick}
        selectedCells={selectedCells}
        isCellSelected={isCellSelected}
      />
      {game && <Controls remaining={game.remaining_adds} onAdd={handleAdd} />}
    </div>
  );
}
